function repeat(direction) 
{

	var canavasnew = document.getElementById("canvasnew");
  	var img = document.getElementById("imagen_temp");
	var svg1 = document.getElementById('svg1');
	var matrix = svg1.createSVGMatrix();

	var c = document.getElementById("canvas_color_final");
	var ctx = c.getContext("2d");
	
	var ctxnew = canavasnew.getContext("2d");
	
	ctxnew.drawImage(img, 0, 0, 250, 250);
	
	ctx.drawImage(canavasnew, 0, 0, 250, 250);
	

}

//// Guardar coordenadas en un arreglo x,y

function storeCoordinate(xVal, yVal, array) 
{
	
	array.push({x: xVal, y: yVal});
}


/////////

function skew(direction) 
{

	var c = document.getElementById('myCanvas');
	var ctx = c.getContext('2d');

	ctx.clearRect(0, 0, c.width, c.height); 
	var img = document.getElementById("imagen_temp")
	var pat = ctx.createPattern(img, direction);

	ctx.transform(1, 0.5, -0.5, 1, 30, 10);
 	ctx.fillStyle = pat;
	ctx.fillRect(0, 0, 500, 450);
	ctx.transform(1, 0.5, -0.5, 1, 30, 10);
	ctx.fillStyle = pat;
	ctx.fillRect(0, 0, 500, 450);

}



